import React from "react";
import ReactDom from "react-dom";
import "./card.css";
const Card = (props) => {
  const { name, email } = props;
  return (
    <div className='bg-light-green dib br3 pad3 ma2 grow'>
      <img src={`https://robohash.org/${props.id}?200*200`} alt='friends' />
      <div>
        <h2>{name}</h2>
        <p>{email}</p>
      </div>
    </div>
  );
};
export default Card;
